import React from 'react'
import Logo from '../../Logo/Logo'
import NavigationItems from '../NavigationItems/NavigationItems'

import './Toolbar.css'

const toolbar = props => {

    const classes = 'Toolbar'
    return (
        <header className={classes}>
            <div>Menu</div>
            {/* <div className='Logo'> */}
                <Logo/>
            {/* </div> */}
            <nav>
                <NavigationItems/>
            </nav>
        </header>
    )
}

export default toolbar
